import React, { Component } from 'react';

class SignUp extends Component {

    render(){
        return(
            <div className="col-xs-12 col-sm-12 col-md-12 col-lg-12">
                <div className="col-xs-3 col-sm-3 col-md-3 col-lg-3">
                    hello 
                </div>
                <div className="col-xs-3 col-sm-3 col-md-3 col-lg-3">
                    oday 
                </div>
            </div>
        )
    }
}

export default SignUp
